import React, { Component } from 'react';
import PersonalForm from './PersonalForm';
import ProfessonalForm from './ProfessonalForm';

class Form extends Component {
  render() {
    return (
      <form>
        <PersonalForm />
        <ProfessonalForm />
      </form>
    )
  }
}

export default Form;
